#include<iostream>
#include<cstring>
using namespace std;
#define LEN 1000

int main(void)
{
	char str1[LEN] = "";
	char str2[LEN] = "";
	int res[LEN] = { 0 };
	int t = 0;
	while (cin>>str1>>str2)
	{
		int len1 = strlen(str1);
		int len2 = strlen(str2);

		int num1[LEN] = { 0 };
		int num2[LEN] = { 0 };
		int index = 0;
		if (len1 >= len2)
			index = len1;
		else
			index = len2;

		for (int i = len1 - 1, t = index - 1; i >= 0; i--, t--)
			num1[t] = str1[i] - '0';

		for (int j = len2 - 1, t = index - 1; j >= 0; j--, t--)
			num2[t] = str2[j] - '0';

		for (int k = index - 1; k >= 0; k--)
			res[k] = num1[k] + num2[k];

		for (int i = index-1; i >0; i--)
		{
			if (res[i]>=10)
			{
				res[i-1]++;
				res[i] = res[i] %10;
			}

		}

		for (int i = 0; i < index; i++)
		{
			cout << res[i];
		}

		cout << endl;

	}
	return 0;
}
